import './App.css';
import { useState } from 'react';
import axios from 'axios'; // Import Axios library

function App() {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    pw: ''
  });

  // Function to handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/user/create', formData); // Use Axios for POST request

      // Handle the response
      console.log('User created:', response.data);
      // Optionally, you can perform further actions based on the response
    } catch (error) {
      console.error('Error creating user:', error);
    }
  };

  // Function to handle form input changes
  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  return (
    <div className="App">
      <form onSubmit={handleSubmit}>
        {/* Your form inputs go here */}
        <input type="text" name="username" placeholder="Username" onChange={handleChange} />
        <input type="email" name="email" placeholder="Email" onChange={handleChange} />
        <input type="password" name="pw" placeholder="Password" onChange={handleChange} />
        {/* Add more inputs as needed */}

        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
